import Ship from "./Ship";

function ShipList(props) {
  if (props.ships.length === 0) {
    return <h2>Found No Ships.</h2>;
  }

  return (
    <ul>
      {props.ships.map(function (ship) {
        return (
          <Ship
            key={ship.id}
            name={ship.name}
            price={ship.price}
            date={ship.date}
          />
        );
      })}
    </ul>
  );
}
export default ShipList;
